import Header from "../partials/head";
import {GlobalNavbar} from "../partials/components";
import React from "react";
import './index.scss'

export default function Email() {
    return (
        <div>
            <Header page_name="Home"/>
            <GlobalNavbar/>
            <div className={'email'}>harrisbegca@gmail.com</div>
        </div>
    )
}
